-- Creating the schema
create schema commodity_db;

-- Using the schema
use commodity_db;

-- Creating tables
DROP TABLE IF EXISTS commodities_info;

CREATE TABLE commodities_info (
  `Id` varchar(4) NOT NULL,
  `Commodity` varchar(20) DEFAULT NULL,
  `Variety` varchar(25) DEFAULT NULL,
  `Unit` varchar(15) DEFAULT NULL,
  `Category` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`Id`)
);

DROP TABLE IF EXISTS region_info;

CREATE TABLE region_info (
  `Id` int NOT NULL,
  `Centre` varchar(20) DEFAULT NULL,
  `State` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`Id`)
);

DROP TABLE IF EXISTS price_details;
CREATE TABLE price_details (
  `Id` int NOT NULL,
  `Region_Id` INT DEFAULT NULL,
  `Commodity_Id` varchar(4) NOT NULL,
  `Date` date DEFAULT NULL,
  `Retail_Price` decimal(12,2) DEFAULT NULL,
  PRIMARY KEY (`Id`)
);

